const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "high-performance-habits---brendon-burchard"
    }}>{`High Performance Habits - Brendon Burchard`}</h1>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#high-performance-habits---brendon-burchard"
        }}>{`High Performance Habits - Brendon Burchard`}</a><ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "#personal-habits"
            }}>{`Personal Habits`}</a><ul parentName="li">
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#seek-clarity"
                }}>{`Seek Clarity`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#generate-energy"
                }}>{`Generate Energy`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#raise-necessity"
                }}>{`Raise Necessity`}</a></li>
            </ul></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "#social-habits"
            }}>{`Social Habits`}</a><ul parentName="li">
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#increase-productivity"
                }}>{`Increase Productivity`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#demonstrate-courage"
                }}>{`Demonstrate Courage`}</a></li>
            </ul></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "#sustaining-success"
            }}>{`Sustaining Success`}</a><ul parentName="li">
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#beware-three-traps"
                }}>{`Beware Three Traps`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#the-number-one-thing"
                }}>{`The Number One Thing`}</a></li>
            </ul></li>
        </ul></li>
    </ul>
    <h2 {...{
      "id": "personal-habits"
    }}>{`Personal Habits`}</h2>
    <ol>
      <li parentName="ol">{`Seek Clarity`}</li>
      <li parentName="ol">{`Generate Energy`}</li>
      <li parentName="ol">{`Raise Necessity`}</li>
    </ol>
    <h3 {...{
      "id": "seek-clarity"
    }}>{`Seek Clarity`}</h3>
    <ul>
      <li parentName="ul">{`"If you leave your growth the randomness, you'll always live in the land of mediocrity."`}</li>
      <li parentName="ul">{`No goals, no growth. No clarity, no change.`}</li>
      <li parentName="ul">{`"Unhappiness is not knowing what we want and killing ourseles to get it." - Don Herold`}</li>
      <li parentName="ul">{`Is work just a job, an important career or a calling.`}</li>
      <li parentName="ul">{`Enthusiasm + Connection + Satisfaction + Coherence = Meaning`}</li>
    </ul>
    <h3 {...{
      "id": "generate-energy"
    }}>{`Generate Energy`}</h3>
    <ul>
      <li parentName="ul">{`There's perhaps no better way to increase ongoing happiness than to start a gratitude practice.`}</li>
    </ul>
    <h3 {...{
      "id": "raise-necessity"
    }}>{`Raise Necessity`}</h3>
    <ul>
      <li parentName="ul">{`Four forces of necessity: identity, obsession, duty and urgency.`}</li>
      <li parentName="ul">{`When you are passionate about what you do, people understand. When you are obsessed, they think you're mad. That's the difference.`}</li>
      <li parentName="ul">{`This is the way high performers speak about their goals and their whys. They don't sound doubtful. They have confidence in the reasons they are working so hard and they are proud to tell you about their purpose.`}</li>
    </ul>
    <h2 {...{
      "id": "social-habits"
    }}>{`Social Habits`}</h2>
    <ol {...{
      "start": 4
    }}>
      <li parentName="ol">{`Increase Productivity`}</li>
      <li parentName="ol">{`Develop Influence`}</li>
      <li parentName="ol">{`Demonstrate Courage`}</li>
    </ol>
    <h3 {...{
      "id": "increase-productivity"
    }}>{`Increase Productivity`}</h3>
    <ul>
      <li parentName="ul">{`The fundamentals: setting goals and maintaining energy and focus. No goals, no focus, no energy - you are dead in the water.`}</li>
      <li parentName="ul">{`Organise life into ten distinct categories: health, family, friends, intimate relationship, mission/work, finances, adventure, hobby, spirituality and emotion.`}</li>
    </ul>
    <h3 {...{
      "id": "demonstrate-courage"
    }}>{`Demonstrate Courage`}</h3>
    <ul>
      <li parentName="ul">{`"Only those who risk going too far can possibly find out how far one will go." - T.S. Eliot.`}</li>
    </ul>
    <h2 {...{
      "id": "sustaining-success"
    }}>{`Sustaining Success`}</h2>
    <ol {...{
      "start": 7
    }}>
      <li parentName="ol">{`Beware Three Traps`}</li>
      <li parentName="ol">{`The #1 Thing`}</li>
      <li parentName="ol">{`Summary Guide`}</li>
    </ol>
    <h3 {...{
      "id": "beware-three-traps"
    }}>{`Beware Three Traps`}</h3>
    <ul>
      <li parentName="ul">{`Keep telling yourself other people won't understand and it becomes a self-fulfilling prophecy.`}</li>
      <li parentName="ul">{`The exhausting, negative, emotional prison that is constant dissatisfaction saps performance. Perennial dissatisfaction is the first step on the path to misery.`}</li>
    </ul>
    <h3 {...{
      "id": "the-number-one-thing"
    }}>{`The Number One Thing`}</h3>
    <ul>
      <li parentName="ul">{`Nothing correlates like confidence.`}</li>
      <li parentName="ul">{`You can not be congruent with something you've never defined. no clarity, no congruence, no confidence. It is that simple.`}</li>
    </ul>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
